import React from 'react';

import './CompanyLogo.css';

function CompanyLogo() {
  return (
    <div className="company__section">
      <div className="container">
        <h2 className="company__section_title">
          WSPÓŁPRACUJEMY
        </h2>
        <div className="companu__section_image">
          <img src="./img/lg_logo.png" alt="lg logo" />
          <img src="./img/keno_logo.png" alt="keno logo" />
          <img src="./img/jinko_logo.png" alt="jinko logo" />
          <img src="./img/qcells_logo.png" alt="qcells logo" />
          <img src="./img/ml_logo.jpg" alt="ml logo" />
        </div>
      </div>
    </div>
  );
}
export default CompanyLogo;
